import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useParams, useNavigate } from 'react-router-dom';

const PerfilComercial = () => {
  const { id } = useParams();
  const [profesional, setProfesional] = useState({});
  const navigate = useNavigate();



useEffect(() => {
  axios.get(`http://localhost:3000/profesional/${id}`)
    .then(response => {
      console.log(response.data);
      setProfesional(response.data);
    })
    .catch(error => console.error(error));
}, [id]);




  const handleClose = () => {
    navigate(-1); // Regresa a la página anterior

 
    console.log(profesional);
  };
  return (
    <div>
      <h2>Perfil de {profesional.nombre}</h2>
      <p>Descripción: {profesional.descripcion}</p>
      <p>Especialidad: {profesional.especialidad}</p>
        
                <h2>{profesional.empresa}.</h2>
                <p>Email: {profesional.email}</p>
                <p>Tel: {profesional.telefono}</p>
                <p>Dirección: {profesional.direccion}</p>
                <p>Valoración promedio: {profesional.valoracion}</p>
                <p>Fecha Nacimiento: {profesional.fechaNacimiento}</p>
                <p>Descripcion: {profesional.descripcion}</p>
      <button onClick={handleClose}>Cerrar</button>
    </div>
  );
};
export default PerfilComercial;
